import React, { Component } from 'react';
import { connect } from 'react-redux';
import { Form, Row, Col, Button } from 'react-bootstrap';
import Header, { HeaderLeft, HeaderCenter, HeaderRight } from '../../components/Dealer/Header';
import Footer from '../../components/Dealer/Footer';
import { IconEnvelopeOpen, IconEnvelopeClosed, IconArrowLeft, IconAwesomePaperPlane, IconAwesomePenFancy, IconAwesomePenFancyRight, IconOpenEnvelopeClosed, IconSortInActive, IconSortActive, IconSearchInActive, IconSearchActive, IconFilterActive, IconFilterInActive } from '../../assets/images';
import { getSalesList, getAppDetailById } from '../../redux/actions/sales';

class DealerIncomplete extends Component {

    state = {
    }

    componentDidMount() {
        // document.addEventListener("mousedown", this.handleClickOutside);
    }

    componentWillUnmount() {
        // document.removeEventListener("mousedown", this.handleClickOutside);
    }

    handleArrowBack = () => {
        this.props.history.goBack();
    }

    render() {
        return (
            <div className="fix-issue-section">
                <Header>
                    <HeaderLeft>
                        <img src={IconArrowLeft} onClick={this.handleArrowBack} height="28"/>
                    </HeaderLeft>
                    <HeaderCenter>
                        <span>FIX ISSUE</span>
                    </HeaderCenter>
                    <HeaderRight>
                    </HeaderRight>
                </Header>
                <div className="fix-issue-main">
                    <Row>
                        <Col xs={6}>
                            <Button><img src={IconAwesomePaperPlane} /></Button>
                            <Button><img src={IconEnvelopeOpen} /></Button>
                            <Button><img src={IconAwesomePenFancy} /></Button>
                        </Col>
                        <Col xs={6}>
                            <Button className={`${index > 2 && "active-mark"}`} onClick={() => {this.props.history.push(`/dealer-fix`)}}>{IconSend}</Button>
                            <Button><img src={IconEnvelopeClosed} /></Button>
                            <Button><img src={IconAwesomePenFancyRight} /></Button>
                        </Col>
                    </Row>
                </div>            
            </div>
        )
    }
}


const mapStateToProps = state => ({
    apps: state.sales.apps
});

export default connect(
    mapStateToProps,
    {
        getSalesList,
        getAppDetailById
    }
)(DealerIncomplete);
